PrivÃƒÂ©detective Sherlock Holmes (Robert Downey Jr.) en zijn vriend, huisgenoot en loyale assistent Dr. John Watson (Jude Law) 
grijpen in bij een geheim ritueel waarbij ze de invloedrijke Lord Blackwood (Mark Strong) te pakken weten te krijgen. Blackwood 
verdwijnt achter de tralies en wordt veroordeeld tot de strop. Hij schijnt over duistere krachten te beschikken, kan dingen 
doen waar geen verklaring voor bestaat en beweert zelfs dat hij kan herrijzen uit de dood. Dit zorgt ervoor dat Holmes en 
Watson, bijgestaan door Irene Adler (Rachel McAdams), zich onvrijwillig met hun 'laatste' zaak bezig moeten gaan houden. Ze 
zullen hun krachten moeten bundelen om te overleven in dit mysterieuze plot wat bedreigend is voor heel Engeland.
